import socketIO from 'socket.io-client';
import CommandBar from './components/CommandBar';
const socket = socketIO.connect('http://localhost:4000');

export default function App() {
  return (
    <MessageWindow socket={socket}/>>
    CommandBar({socket})
  );
}
